import React from "react";
import ReactDOM from "react-dom";
import * as App from "./App"
import "./index.css";

ReactDOM.render(
    <>
    <App />
        <ul>
            <li>sum of two no is{App.add()}</li>
            <li>sum of two no is{App.sub()}</li>
            <li>sum of two no is{App.mul()}</li>
            <li>sum of two no is{App.div()}</li>
        </ul>
    </>,
    document.getElementById("root")
);
